BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "airports" (
	"id"	INTEGER NOT NULL,
	"name"	VARCHAR(255) NOT NULL,
	"iata_code"	VARCHAR(3) NOT NULL,
	"icao_code"	VARCHAR(4),
	"latitude"	FLOAT,
	"longitude"	FLOAT,
	"timezone"	VARCHAR(50),
	"location_id"	INTEGER,
	UNIQUE("iata_code"),
	PRIMARY KEY("id"),
	FOREIGN KEY("location_id") REFERENCES "locations"("id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "artists" (
	"id"	INTEGER NOT NULL,
	"display_name"	VARCHAR(255) NOT NULL,
	"edmtrain_id"	INTEGER,
	"normalized_name"	VARCHAR(255) NOT NULL,
	"genres"	TEXT,
	"image_url"	TEXT,
	"spotify_id"	VARCHAR(64),
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "genres" (
	"id"	INTEGER NOT NULL,
	"genre_name"	VARCHAR(64) NOT NULL,
	"parent_genre"	VARCHAR(64),
	"energy"	INTEGER,
	"mood_tags"	TEXT,
	UNIQUE("genre_name"),
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "locations" (
	"id"	INTEGER NOT NULL,
	"name"	VARCHAR(100) NOT NULL,
	"city"	VARCHAR(100),
	"state"	VARCHAR(100),
	"state_code"	VARCHAR(10),
	"latitude"	FLOAT,
	"longitude"	FLOAT,
	"region"	VARCHAR(100),
	"country"	VARCHAR(100),
	"edmtrain_locationid"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "user_favorite_artists" (
	"user_id"	INTEGER NOT NULL,
	"artist_id"	INTEGER NOT NULL,
	PRIMARY KEY("user_id","artist_id"),
	FOREIGN KEY("artist_id") REFERENCES "artists"("id") ON DELETE CASCADE,
	FOREIGN KEY("user_id") REFERENCES "users"("id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "user_favorite_genres" (
	"user_id"	INTEGER NOT NULL,
	"genre_id"	INTEGER NOT NULL,
	PRIMARY KEY("user_id","genre_id"),
	FOREIGN KEY("genre_id") REFERENCES "genres"("id") ON DELETE CASCADE,
	FOREIGN KEY("user_id") REFERENCES "users"("id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "user_favorite_locations" (
	"user_id"	INTEGER NOT NULL,
	"location_id"	INTEGER NOT NULL,
	PRIMARY KEY("user_id","location_id"),
	FOREIGN KEY("location_id") REFERENCES "locations"("id") ON DELETE CASCADE,
	FOREIGN KEY("user_id") REFERENCES "users"("id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "users" (
	"id"	INTEGER NOT NULL,
	"email"	VARCHAR(120) NOT NULL,
	"password"	VARCHAR(60) NOT NULL,
	"first_name"	VARCHAR(50),
	"last_name"	VARCHAR(50),
	"username"	VARCHAR(50),
	"dob"	DATE,
	"image_file"	VARCHAR(20) NOT NULL,
	"home_location_id"	INTEGER,
	"bio"	VARCHAR(500),
	"onboarding_complete"	VARCHAR(5) NOT NULL,
	UNIQUE("email"),
	PRIMARY KEY("id"),
	UNIQUE("username"),
	FOREIGN KEY("home_location_id") REFERENCES "locations"("id")
);
CREATE UNIQUE INDEX IF NOT EXISTS "ix_artists_edmtrain_id" ON "artists" (
	"edmtrain_id"
);
CREATE INDEX IF NOT EXISTS "ix_artists_normalized_name" ON "artists" (
	"normalized_name"
);
CREATE UNIQUE INDEX IF NOT EXISTS "ix_artists_spotify_id" ON "artists" (
	"spotify_id"
);
CREATE INDEX IF NOT EXISTS "ix_genres_energy" ON "genres" (
	"energy"
);
COMMIT;
